class Aquarium
{
    private List<Fish> _fish = new List<Fish>();

    public Aquarium()
    {
        Fill();
    }

    public void Life()
    {
        Console.WriteLine($"Добро пожаловать в игру под названием \"Аквариум. Часть первая. Жизнь\"");

        while (Game()) { }
    }

    private bool Game()
    {
        const int PasesTime = 1;
        const int AddNewFish = 4;
        const int RemoveFish = 5;
        const int Exit = 9;

        bool isWork = true;

        Console.WriteLine("Сейчас у Вас в аквариуме есть следующие рыбки:");
        this.ShowInfo();

        Console.WriteLine($"\nВведите команду: \n{PasesTime} - Ничего не делать, пройдёт время, " +
            $"\n{AddNewFish} - Добавить рыбку, \n{RemoveFish} - Достать рыбку,\n{Exit} - Выход из игры.");

        switch (ReadInt())
        {
            case PasesTime:
                this.PasesTime();
                break;

            case AddNewFish:
                this.AddNewFish();
                break;

            case RemoveFish:
                this.RemoveFish();
                break;

            case Exit:
                isWork = false;
                break;

            default:
                Console.WriteLine("\aТак команды нет.");
                break;
        }

        Console.WriteLine("\nНажмите любую клавишу для продолжения.");
        Console.ReadKey();
        Console.Clear();

        return isWork;
    }

    private void PasesTime()
    {
        for (int i = 0; i < _fish.Count; i++)
        {
            _fish[i].PasesTime();
            if (_fish[i].IsAlive() == false) { _fish.Remove(_fish[i]); }
        }
    }

    private void AddNewFish()
    {
        Console.WriteLine("Введите имя новой рыбки: ");

        _fish.Add(new Fish(Console.ReadLine()));
    }

    private int ReadInt()
    {
        int.TryParse(Console.ReadLine(), out int result);

        return result;
    }

    private Fish GetFish()
    {
        Fish fishFoundet = null;
        bool isFoundIndexFish = false;

        if (_fish.Count == 0)
        {
            isFoundIndexFish = true;
            Console.WriteLine("Увы, аквариум пуст...");
        }

        while (isFoundIndexFish == false)
        {
            Console.Write("\nВведите индекс: ");
            int index = ReadInt();

            for (int i = 0; i < _fish.Count; i++)
            {
                if (index == _fish.Count)
                {
                    isFoundIndexFish = true;
                    fishFoundet = _fish[i];
                }
            }

            if (isFoundIndexFish == false) { Console.Write("\a\nВведено не верное значение."); }
        }

        return fishFoundet;
    }

    private void RemoveFish()
    {
        Fish fish = GetFish();

        if (fish != null)
        { _fish.Remove(fish); }

    }

    private void Fill()
    {
        _fish.Add(new Fish("Красная", 1, 6));
        _fish.Add(new Fish("Зелёная"));
        _fish.Add(new Fish("Мелкая", 0, 2));
        _fish.Add(new Fish("Долгоживущая", 2, 10));
    }

    private void ShowInfo()
    {
        for (int i = 0; i < _fish.Count; i++)
        {
            Console.Write($"\n[{i + 1}] - ");
            _fish[i].ShowInfo();
        }
    }
}

class Fish
{
    private string _name;
    private int _lifetime;
    private int _age;

    public Fish(string name, int age, int lifetime)
    {
        _name = name;
        _age = age;
        _lifetime = lifetime;
    }

    public Fish(string name)
    {
        _name = name;
        _age = 0;
        _lifetime = 5;
    }

    public void ShowInfo()
    {
        Console.Write($"Имя рыбки - {_name}, возраст рыбки - {_age} / {_lifetime}");
    }

    public bool IsAlive()
    {
        return _age <= _lifetime;
    }

    public void PasesTime()
    {
        _age++;
    }
}

/*      Аквариум
  Есть аквариум, в котором плавают рыбы. В этом аквариуме может быть максимум определенное кол-во рыб. 
Рыб можно добавить в аквариум или рыб можно достать из аквариума. 
(программу делать в цикле для того, чтобы рыбы могли “жить”) 

    Все рыбы отображаются списком, у рыб также есть возраст. За 1 итерацию рыбы стареют на определенное кол-во жизней 
и могут умереть. Рыб также вывести в консоль, чтобы можно было мониторить показатели.
*/

#include <iostream>
#include <queue>
#include <vector>
using namespace std;
const int maxn = 105;
int root[maxn], sz[maxn];
void init() {
    for(int i = 0; i < maxn; i++) {
        sz[i] = 1;
        root[i] = i;
    }
}
int find_root(int x) {
    while(x != root[x]) {
        root[x] = root[root[x]];
        x = root[x];
    }
    return x;
}
bool check(int A, int B) {
    return find_root(A) == find_root(B);
}
void unite(int A, int B) {
    int a_root = find_root(A);
    int b_root = find_root(B);
    if(a_root != b_root) {
        if(sz[a_root] > sz[b_root]) {
            sz[a_root] += sz[b_root];
            root[b_root] = root[a_root];
        }
        else {
            sz[b_root] += sz[a_root];
            root[a_root] = root[b_root];
        }
    }
}
int main() {
    int n, m;
    cin >> n >> m;
    vector<pair<int, pair<int, int> > > v;
    
    for(int i = 0; i < m; i++) {
        int a, b, c;
        cin >> a >> b >> c;
        v.push_back(make_pair(c, make_pair(a, b)));
    }
    sort(v.begin(), v.end());
    init();
    
    int MST1 = 0;
    vector<pair<int, int> > mst_edges;
    for(int i = 0; i < m; i++) {
        int a = v[i].second.first;
        int b = v[i].second.second;
        int c = v[i].first;
        if(!check(a, b)) {
            unite(a, b);
            MST1 += c;
            mst_edges.push_back(make_pair(a, b));
        }
    }
    int MST2 = 1e9;
    for(int i = 0; i < (int) mst_edges.size(); i++) {
        init();
        int tmp = 0;
        int cnt = 0;
        for(int j = 0; j < m; j++) {
                int a = v[j].second.first;
                int b = v[j].second.second;
                int c = v[j].first;
            if(a == mst_edges[i].first and b == mst_edges[i].second) continue;
            
                if(!check(a, b)) {
                    unite(a, b);
                    tmp += c;
                    cnt++;
            }
            
        }
        if(cnt == n - 1) {
            MST2 = min(MST2, tmp);
        }
    }
    cout << MST1 << " " << MST2 << endl;
    return 0;
}

{
Сортировка методом Шелла с использованием последовательности Гнута и подмассивов (Подмассивы сортируются методом вставок)
