    int root_A = find_root(A);
    int root_B = find_root(B);
    return root_A == root_B;
}
void unite(int A, int B) {
    int root_A = find_root(A);
    int root_B = find_root(B);
    if(root_A != root_B) {
        if(sz[root_A] > sz[root_B]) {
            root[root_B] = root[root_A];
            sz[root_A] += sz[root_B];
        }
        else {
            root[root_A] = root[root_B];
            sz[root_B] += sz[root_A];
        }
    }
    
    
}
