from random import shuffle

class Card:

    numbers = {11: "J", 12: "Q", 13: "K", 14: "A"}
    suits = {"Spades": "♠", "Diamonds": "♦", "Hearts": "♥", "Clubs": "♣"}

    def __init__(self, number, suit):
        self.number = number
        self.suit = suit

    def __repr__(self):
        number = Card.numbers.get(self.number, self.number)
        suit = Card.suits.get(self.suit, self.suit)
        return f"{number}{suit}"

    def __gt__(self, other):
        return self.number > other.number

    def __len__(self):
        return 1

class Deck:

    def __init__(self):
        self.deck = []
        self.create()
        self.shuffle()

    def create(self):
        suits = ["Spades", "Diamonds", "Clubs", "Hearts"]
        for suit in suits:
            for number in range(2, 15):
                self.deck.append(Card(number, suit))

    def shuffle(self):
        shuffle(self.deck)

    def deal(self, no_of_cards):
        cards = []
        for i in range(no_of_cards):
            card = self.deck.pop()
            cards.append(card)
        return cards

class Hand:

    def __init__(self):
        self.cards = []
        self.suits = None
        self._cards_dict = None
        self._cards_dict_same_suit = None

    def sort_cards(self):
        self.cards = sorted(self.cards, reverse=True)

    def show_cards(self):
        text = ""
        for c in self.cards:
            text += f"{c}, "
        return text[:-2]

    def _count_suits(self):
        if not self.suits:
            self.suits = {}
            for c in self.cards:
                self.suits[c.suit] = self.suits.get(c.suit, 0) + 1

    @property
    def max_number_of_same_suit(self):
        self._count_suits()
        return max([x for x in self.suits.values()])

    @property
    def max_type_of_same_suit(self):
        self._count_suits()
        y = max([(v, k) for k, v in self.suits.items()])
        return y[1]

    @property
    def cards_dict(self):
        if self._cards_dict is None:
            self._cards_dict = {}
            for i in range(2, 15):
                self._cards_dict[i] = []
            for c in self.cards:
                self._cards_dict[c.number].append(c)
        return self._cards_dict

    @property
    def cards_dict_same_suit(self):
        if self._cards_dict_same_suit is None:
            self._cards_dict_same_suit = {}
            for i in range(2, 15):
                self._cards_dict_same_suit[i] = []
            for k, v in self._cards_dict.items():
                for c in v:
                    if c.suit == self.max_type_of_same_suit:
                        self._cards_dict_same_suit[k] = c
        return self._cards_dict_same_suit


